
<!DOCTYPE html>

<html lang="pt-BR">
<head>
<meta charset="utf-8"/>
<meta content="width=device-width, initial-scale=1.0" name="viewport"/>
<title>Stellantis | Segurança Patrimonial</title>
<style>
    body {
      margin: 0;
      padding: 0;
      font-family: 'Segoe UI', sans-serif;
      background-color: #003584;
      color: #fff;
      display: flex;
      flex-direction: column;
      align-items: center;
      min-height: 100vh;
    }
    .logo {
      max-width: 260px;
      margin: 30px auto 10px;
    }
    .login {
      margin-top: 40px;
      text-align: center;
    }
    .login input {
      padding: 10px;
      margin: 10px;
      width: 220px;
      border: none;
      border-radius: 8px;
      font-size: 16px;
    }
    .login button {
      padding: 12px 24px;
      background-color: #1565c0;
      border: none;
      border-radius: 10px;
      color: white;
      font-size: 16px;
      cursor: pointer;
      margin-top: 10px;
    }
    .grid {
      display: grid;
      grid-template-columns: repeat(2, 160px);
      gap: 20px;
      margin-top: 40px;
    }
    .btn {
      background: linear-gradient(145deg, #1976d2, #003584);
      border-radius: 16px;
      padding: 20px;
      text-align: center;
      transition: all 0.3s ease;
      box-shadow: 0 4px 10px rgba(0,0,0,0.3);
      font-size: 14px;
      animation: fadeIn 0.5s ease-in-out;
    }
    .btn:hover {
      transform: translateY(-4px) scale(1.04);
      background: #1565c0;
      cursor: pointer;
    }
    .btn i {
      font-size: 28px;
      margin-bottom: 10px;
      display: block;
    }
    .footer {
      margin-top: 40px;
      font-size: 13px;
      color: #bbdefb;
    }
    #interface, #user-info {
      display: none;
      text-align: center;
    }
    #user-info {
      margin-top: 10px;
      font-size: 15px;
      color: #cfd8dc;
    }
    .logout-btn {
      margin-top: 10px;
      background: #c62828;
      border: none;
      border-radius: 8px;
      color: white;
      padding: 10px 20px;
      font-size: 14px;
      cursor: pointer;
    }
    @keyframes fadeIn {
      from { opacity: 0; transform: translateY(10px); }
      to { opacity: 1; transform: translateY(0); }
    }
  </style>
<script>
    function entrar() {
      const nome = document.getElementById('nome').value.trim();
      const registro = document.getElementById('registro').value.trim();

      if (nome && registro) {
        localStorage.setItem('usuario_nome', nome);
        localStorage.setItem('usuario_registro', registro);
        document.getElementById('login').style.display = 'none';
        document.getElementById('interface').style.display = 'block';
        document.getElementById('user-info').style.display = 'block';
        document.getElementById('user-info').innerText = `Usuário: ${nome} | Registro: ${registro}`;
      } else {
        alert('Por favor, preencha nome e registro.');
      }
    }

    function logout() {
      localStorage.removeItem('usuario_nome');
      localStorage.removeItem('usuario_registro');
      location.reload();
    }

    window.onload = function() {
      const nome = localStorage.getItem('usuario_nome');
      const registro = localStorage.getItem('usuario_registro');
      if (nome && registro) {
        document.getElementById('login').style.display = 'none';
        document.getElementById('interface').style.display = 'block';
        document.getElementById('user-info').style.display = 'block';
        document.getElementById('user-info').innerText = `Usuário: ${nome} | Registro: ${registro}`;
      }
    }

    function openApp(file) {
      window.location.href = file;
    }
  </script>

<div class="login" id="login">
<input id="nome" placeholder="Nome do usuário" type="text"/>
<br/>
<input id="registro" placeholder="Registro" type="text"/>
<br/>
<button onclick="entrar()">Entrar</button>
</div>
<div id="user-info"></div>
<button class="logout-btn" id="logoutBtn" onclick="logout()" style="display:none;">Sair</button>
<div id="interface">
<div class="grid">
<div class="btn" onclick="openApp('Controle_lacres.html')">
<i class="fas fa-lock"></i>
        Controle de lacres
      </div>
<div class="btn" onclick="openApp('Controle_MVM.html')">
<i class="fas fa-clipboard-list"></i>
        Controle de MVM
      </div>
<div class="btn" onclick="openApp('pecas_encontradas.html')">
<i class="fas fa-search"></i>
        Peças encontradas
      </div>
<div class="btn" onclick="openApp('procedimentos.html')">
<i class="fas fa-cogs"></i>
        Procedimentos
      </div>
</div>
<div class="footer">STELLANTIS</div>
<div style="margin-top: 30px;"><button class="logout-btn" onclick="logout()">Sair</button></div></div>
<script>
    // Mostrar botão de logout se o usuário estiver logado
    if (localStorage.getItem('usuario_nome') && localStorage.getItem('usuario_registro')) {
      document.getElementById('logoutBtn').style.display = 'inline-block';
    }
  </script>

<script>
  const nomeUsuario = localStorage.getItem('usuario_nome') || '';
  document.addEventListener('DOMContentLoaded', () => {
    const camposConferente = document.querySelectorAll('[name="conferente"]');
    camposConferente.forEach(campo => {
      campo.value = nomeUsuario;
    });
  });
</script>


<script>
document.addEventListener('DOMContentLoaded', () => {
  const nome = localStorage.getItem('usuario_nome') || '';
  const registro = localStorage.getItem('usuario_registro') || '';
  const camposConferente = document.querySelectorAll('input[name="conferente"]');
  camposConferente.forEach(campo => {
    campo.value = nome + ' - ' + registro;
  });
});
</script>

</body>
</html>
